// Get textures\n    const baseTexture = PIXIAssets.get('character_sheet');\n    const grassSheet = PIXIAssets.get('grass_sheet');\n    // Set scale mode to nearest neighbor for pixel art\n    baseTexture.source.scaleMode = 'nearest';\n    grassSheet.source.scaleMode = 'nearest';\n    // Create texture frames from the character spritesheet\n    const characterFrames = asTextureFrames(PIXI, baseTexture, {\n        frameWidth: 48,\n        frameHeight: 48,\n        columns: 4,\n        rows: 4\n    });\n    const grassFrames = asTextureFrames(PIXI, grassSheet, {\n        frameWidth: 16,\n        frameHeight: 16,\n        columns: 11,\n        rows: 7\n    });\n    const walkAnimationSpeed = 12;\n    const idleAnimationSpeed = walkAnimationSpeed + 10;\n    const frameSequences = {\n        idleDown: { frames: [0, 1], animationSpeed: idleAnimationSpeed },\n        walkDown: { frames: [2, 3], animationSpeed: walkAnimationSpeed },\n        idleUp: { frames: [4, 5], animationSpeed: idleAnimationSpeed },\n        walkUp: { frames: [6, 7], animationSpeed: walkAnimationSpeed },\n        idleLeft: { frames: [8, 9], animationSpeed: idleAnimationSpeed },\n        walkLeft: { frames: [10, 11], animationSpeed: walkAnimationSpeed },\n        idleRight: { frames: [12, 13], animationSpeed: idleAnimationSpeed },\n        walkRight: { frames: [14, 15], animationSpeed: walkAnimationSpeed }\n    };\n    // Get color variant grass tiles and stone paths from rows 5-6, columns 0-5\n    // Row 5, cols 0-5: indices 55-60 (grass1-3, stonepath1-2, yellow flowers)\n    // Row 6, cols 0-5: indices 66-71 (grass4-6, stonepath3-4, yel flowers2)\n    const colorVariantTiles = getTextureRange(grassFrames, 55, 6);\n    const stonePathTiles = getTextureRange(grassFrames, 66, 6);\n    // Combine tile pools for randomization\n    const tileVariations = [\n        ...colorVariantTiles,\n        ...stonePathTiles\n    ];\n    const textureFrameSequences = new TextureFrameSequences(characterFrames, frameSequences);\n    // Create a background container with the grass tiles\n    const backgroundContainer = createTileGrid({\n        width: 64,\n        height: 64,\n        cellWidth: 16,\n        cellHeight: 16,\n        centered: true\n    }, tileVariations);\n    // Convert background container to a Moxi entity and add to scene\n    const backgroundEntity = asEntity(backgroundContainer);\n    scene.addChild(backgroundEntity);\n    // Create bunny player sprite\n    const bunny = new PIXI.AnimatedSprite(characterFrames);\n    bunny.anchor.set(0.5);\n    // Convert to Moxi entity\n    const bunnyEntity = asEntity(bunny);\n    // Create and initialize the movement logic with custom options\n    const movementLogic = new PlayerMovementLogic({\n        speed: 1.5,\n    }, textureFrameSequences);\n    // Initialize the logic with the sprite\n    movementLogic.init(bunny, scene.renderer);\n    // Add the logic to the entity\n    bunnyEntity.moxiEntity.addLogic(movementLogic);\n    // Add player to scene\n    scene.addChild(bunnyEntity);\n    // Make camera follow the player\n    const cameraLogic = camera.moxiEntity.getLogic('CameraLogic');\n    cameraLogic.target = bunny;\n    // Initialize and start\n    scene.init();\n    engine.start();\n    console.log(' Bunny Adventure example loaded - Use arrow keys to move!');\n}\n"},"parallax-shooter":{name:"Parallax Shooter",description:"Asteroids-style space shooter with parallax",init:async function(){const t=document.getElementById("canvas-container");if(!t)throw new Error("App element not found");const{scene:i,engine:n,loadAssets:o,camera:s,PIXIAssets:r}=await Sr({hostElement:t,showLoadingScene:!0});i.renderer.background.color=16738740,await o([{src:Wr.SPACE_NEBULA_BLUE,alias:"nebula"},{src:Wr.SPACE_STARS_SMALL_2,alias:"stars"},{src:Wr.SPACE_SHOOTER_JSON,alias:"space_shooter"}]),console.log(" Space assets loaded");const a=new Vr({camera:s}),l=r.get("nebula"),h=new $r({texture:l,scrollScale:new e.Point(.3,.3)});a.addLayer(h);const c=r.get("stars"),d=new $r({texture:c,scrollScale:new e.Point(.6,.6)});d.tilingSprite.tileScale.set(.5,.5),a.addLayer(d),i.addChild(a);const u=Br({texture:r.get("space_shooter").textures["playerShip1_blue.png"]},{scale:.5}),p=T(u),m=new Ea;p.moxiEntity.addLogic(m),i.addChild(p),s.desiredScale.set(1.5);const f=s.moxiEntity.getLogic("CameraLogic");f.target=u,f.speed=.15,s.moxiEntity.addLogic(new Ia);const g=T(new e.Container);return g.moxiEntity.addLogic(new Ba(u,s)),i.addChild(g),i.init(),n.start(),console.log(" Parallax Space Shooter loaded!"),console.log("    Controls: Left/Right or A/D to rotate"),console.log("    Up/W to thrust forward, Down/S for reverse"),console.log("     Mouse wheel: Zoom in/out (0.5x - 3x)"),console.log("    Watch the parallax effect as you move!"),console.log("    Nebula layer: 0.3x speed (far)"),console.log("    Stars layer: 0.6x speed (closer)"),()=>{n.stop(),i.destroy({children:!0})}},source:"import { setupMoxi, asEntity, ParallaxBackground, TilingParallaxLayer, Logic, asSprite } from '@moxijs/core';\nimport * as PIXI from 'pixi.js';\nimport { ASSETS } from '../../assets-config';\nimport { ClientEvents } from '@moxijs/core';\n/**\n * Parallax Space Shooter Example\n * Demonstrates parallax scrolling with multiple layers at different speeds\n * Features:\n * - Nebula background layer (slow scroll - 0.3x)\n * - Stars foreground layer (medium scroll - 0.6x)\n * - Player ship with keyboard controls\n * - Camera following the player\n * - Mouse wheel zoom in/out to test parallax with camera scale\n */\n/**\n * HUD display logic for debugging camera and ship positions\n */\nclass HudDisplayLogic extends Logic {\n    constructor(ship, camera) {\n        super();\n        this.name = 'HudDisplayLogic';\n        this.ship = ship;\n        this.camera = camera;\n    }\n    init(entity, renderer) {\n        const textStyle = new PIXI.TextStyle({\n            fontFamily: 'monospace',\n            fontSize: 14,\n            fill: 0xFFFFFF,\n            stroke: { color: 0x000000, width: 2 }\n        });\n        this.shipText = new PIXI.Text({ text: '', style: textStyle });\n        this.shipText.position.set(10, 10);\n        this.cameraText = new PIXI.Text({ text: '', style: textStyle });\n        this.cameraText.position.set(10, 30);\n        this.zoomText = new PIXI.Text({ text: '', style: textStyle });\n        this.zoomText.position.set(10, 50);\n        entity.addChild(this.shipText);\n        entity.addChild(this.cameraText);\n        entity.addChild(this.zoomText);\n    }\n    update(entity, deltaTime) {\n        // Position HUD in screen space by countering scene transforms\n        // HUD is in the scene, so we need to position it relative to camera\n        const scene = entity.parent;\n        if (scene) {\n            // Counter the scene's position and scale to stay in screen space\n            entity.position.x = -scene.position.x / scene.scale.x;\n            entity.position.y = -scene.position.y / scene.scale.y;\n            entity.scale.x = 1 / scene.scale.x;\n            entity.scale.y = 1 / scene.scale.y;\n        }\n        // Update text with current values\n        this.shipText.text = `Ship: (${this.ship.x.toFixed(1)}, ${this.ship.y.toFixed(1)})`;\n        this.cameraText.text = `Camera: (${this.camera.position.x.toFixed(1)}, ${this.camera.position.y.toFixed(1)})`;\n        this.zoomText.text = `Zoom: ${this.camera.scale.x.toFixed(2)}x`;\n    }\n}\n/**\n * Camera zoom logic using mouse wheel\n */\nclass CameraZoomLogic extends Logic {\n    constructor() {\n        super(...arguments);\n        this.name = 'CameraZoomLogic';\n        this.minZoom = 0.5;\n        this.maxZoom = 3;\n        this.zoomSpeed = 0.1;\n    }\n    init(entity, renderer) {\n        this.clientEvents = new ClientEvents();\n    }\n    update(entity, deltaTime) {\n        // Get wheel delta from ClientEvents\n        const wheelDelta = this.clientEvents.wheelOffsets.y;\n        if (wheelDelta !== 0) {\n            // Zoom in (wheel up) or out (wheel down)\n            const zoomDelta = -wheelDelta * this.zoomSpeed * 0.01;\n            const newZoom = entity.desiredScale.x + zoomDelta;\n            // Clamp zoom to min/max range\n            const clampedZoom = Math.max(this.minZoom, Math.min(this.maxZoom, newZoom));\n            entity.desiredScale.set(clampedZoom);\n            // Reset wheel offsets after processing\n            this.clientEvents.wheelOffsets.y = 0;\n        }\n    }\n}\n/**\n * Asteroids-style ship movement with thrust and drag\n */\nclass ShipMovementLogic extends Logic {\n    constructor() {\n        super(...arguments);\n        this.name = 'ShipMovementLogic';\n        // Physics parameters\n        this.thrust = 0.25; // Acceleration force when thrusting\n        this.drag = 0.98; // Velocity multiplier per frame (0.98 = 2% drag)\n        this.maxSpeed = 12; // Maximum velocity magnitude\n        this.rotationSpeed = 0.08; // How fast ship rotates (radians per frame * deltaTime)\n        // Persistent velocity\n        this.velocityX = 0;\n        this.velocityY = 0;\n    }\n    init(entity, renderer) {\n        this.clientEvents = new ClientEvents();\n        // Center the ship\n        entity.anchor.set(0.5);\n        entity.x = 0;\n        entity.y = 0;\n        console.log(' Ship initialized - Asteroids controls!');\n    }\n    update(entity, deltaTime) {\n        // Rotation: Left/Right or A/D rotates the ship\n        if (this.clientEvents.isKeyDown('ArrowLeft') || this.clientEvents.isKeyDown('a')) {\n            entity.rotation -= this.rotationSpeed * deltaTime;\n        }\n        if (this.clientEvents.isKeyDown('ArrowRight') || this.clientEvents.isKeyDown('d')) {\n            entity.rotation += this.rotationSpeed * deltaTime;\n        }\n        // Thrust: Up/W applies force in the direction the ship is facing\n        if (this.clientEvents.isKeyDown('ArrowUp') || this.clientEvents.isKeyDown('w')) {\n            // Ship sprite faces up (negative Y), so rotation 0 = facing up\n            // Convert rotation to thrust direction (subtract PI/2 because sprite faces up)\n            const thrustAngle = entity.rotation - Math.PI / 2;\n            this.velocityX += Math.cos(thrustAngle) * this.thrust * deltaTime;\n            this.velocityY += Math.sin(thrustAngle) * this.thrust * deltaTime;\n        }\n        // Optional: Reverse thrust with Down/S\n        if (this.clientEvents.isKeyDown('ArrowDown') || this.clientEvents.isKeyDown('s')) {\n            const thrustAngle = entity.rotation - Math.PI / 2;\n            this.velocityX -= Math.cos(thrustAngle) * this.thrust * 0.5 * deltaTime;\n            this.velocityY -= Math.sin(thrustAngle) * this.thrust * 0.5 * deltaTime;\n        }\n        // Clamp to max speed\n        const speed = Math.sqrt(this.velocityX * this.velocityX + this.velocityY * this.velocityY);\n        if (speed > this.maxSpeed) {\n            this.velocityX = (this.velocityX / speed) * this.maxSpeed;\n            this.velocityY = (this.velocityY / speed) * this.maxSpeed;\n        }\n        // Apply drag (friction)\n        this.velocityX *= this.drag;\n        this.velocityY *= this.drag;\n        // Stop completely if very slow (prevents infinite micro-drift)\n        if (Math.abs(this.velocityX) < 0.01)\n            this.velocityX = 0;\n        if (Math.abs(this.velocityY) < 0.01)\n            this.velocityY = 0;\n        // Apply velocity to position\n        entity.x += this.velocityX * deltaTime;\n        entity.y += this.velocityY * deltaTime;\n    }\n}\nexport async function initParallaxSpaceShooter() {\n    const root = document.getElementById('canvas-container');\n    if (!root)\n        throw new Error('App element not found');\n    const { scene, engine, loadAssets, camera, PIXIAssets } = await setupMoxi({\n        hostElement: root,\n        showLoadingScene: true\n    });\n    // Set space background color\n    scene.renderer.background.color = 0xFF69B4; // Hot pink (DEBUG)\n    // Load space assets\n    await loadAssets([\n        { src: ASSETS.SPACE_NEBULA_BLUE, alias: 'nebula' },\n        { src: ASSETS.SPACE_STARS_SMALL_2, alias: 'stars' },\n        { src: ASSETS.SPACE_SHOOTER_JSON, alias: 'space_shooter' }\n    ]);\n    console.log(' Space assets loaded');\n    // Create parallax background container\n    const parallaxBg = new ParallaxBackground({\n        camera: camera\n    });\n    // Layer 1: Nebula (slowest - appears farthest away)\n    const nebulaTexture = PIXIAssets.get('nebula');\n    const nebulaLayer = new TilingParallaxLayer({\n        texture: nebulaTexture,\n        scrollScale: new PIXI.Point(0.3, 0.3) // Moves at 30% of camera speed\n        // width/height auto-detected from renderer\n    });\n    parallaxBg.addLayer(nebulaLayer);\n    // Layer 2: Stars (medium speed - closer than nebula)\n    const starsTexture = PIXIAssets.get('stars');\n    const starsLayer = new TilingParallaxLayer({\n        texture: starsTexture,\n        scrollScale: new PIXI.Point(0.6, 0.6) // Moves at 60% of camera speed\n        // width/height auto-detected from renderer\n    });\n    // Scale stars down by 50% for smaller, more numerous appearance\n    starsLayer.tilingSprite.tileScale.set(0.5, 0.5);\n    parallaxBg.addLayer(starsLayer);\n    // Add parallax background to scene\n    scene.addChild(parallaxBg);\n    // Create player ship\n    // PIXI.Assets.get with spritesheet returns the spritesheet, access textures via .textures\n    const spaceShooterSheet = PIXIAssets.get('space_shooter');\n    const playerTexture = spaceShooterSheet.textures['playerShip1_blue.png'];\n    const playerShip = asSprite({ texture: playerTexture }, { scale: 0.5 });\n    // Convert to Moxi entity\n    const shipEntity = asEntity(playerShip);\n    // Add ship movement logic\n    const movementLogic = new ShipMovementLogic();\n    shipEntity.moxiEntity.addLogic(movementLogic);\n    // Add ship to scene\n    scene.addChild(shipEntity);\n    // Set up camera to follow the player\n    camera.desiredScale.set(1.5); // Slight zoom\n    const cameraLogic = camera.moxiEntity.getLogic('CameraLogic');\n    cameraLogic.target = playerShip;\n    cameraLogic.speed = 0.15; // Tighter camera following\n    // Add zoom control with mouse wheel\n    camera.moxiEntity.addLogic(new CameraZoomLogic());\n    // Create HUD container (in screen space, not affected by camera)\n    const hudContainer = new PIXI.Container();\n    const hudEntity = asEntity(hudContainer);\n    hudEntity.moxiEntity.addLogic(new HudDisplayLogic(playerShip, camera));\n    // Add HUD directly to renderer/stage, not to scene\n    // We need to render it separately after the scene\n    // For now, add it to scene but we'll position it in screen space\n    scene.addChild(hudEntity);\n    // Initialize and start\n    scene.init();\n    engine.start();\n    console.log(' Parallax Space Shooter loaded!');\n    console.log('    Controls: Left/Right or A/D to rotate');\n    console.log('    Up/W to thrust forward, Down/S for reverse');\n    console.log('     Mouse wheel: Zoom in/out (0.5x - 3x)');\n    console.log('    Watch the parallax effect as you move!');\n    console.log('    Nebula layer: 0.3x speed (far)');\n    console.log('    Stars layer: 0.6x speed (closer)');\n    // Return cleanup function\n    return () => {\n        engine.stop();\n        scene.destroy({ children: true });\n    };\n}\n"}}},"npc-behaviors":{name:"NPC Behaviors",collapsed:!0,examples:{"dino-behaviors":{name:"Dino NPC Behaviors",description:"FSM behaviors: Follow, Flee, Patrol, Wander",init:async function(){const t=document.getElementById("canvas-container");if(!t)throw new Error("App element not found");const{scene:i,engine:n,loadAssets:o,camera:s,PIXIAssets:r}=await Sr({hostElement:t,showLoadingScene:!0});i.renderer.background.color=8962160,await o([{src:Wr.GRASS_TILES,alias:"grass_sheet"},{src:Wr.GRASS_BIOME_THINGS,alias:"grass_biome_things"},{src:Wr.SPROUTLANDS_CHARACTER,alias:"character_